    })

    for(var i=0; i <this.state.objectIDs.length; i++){
      axios.get("https://collectionapi.metmuseum.org/public/collection/v1/objects/" + this.state.objectIDs[i]).then(objectresults => {
        this.setState({ objectRecord: objectresults[i].data })
      })
      console.log(this.state.objectRecord)
    }



    //use objectIDs to return full object record

  }

  render() {
    return (
      <div>
        <div className="App">
       <TestBody objectIDs={this.state.objectIDs} objectRecord={this.state.objectRecord} />
      </div>
      </div>
    )
  }
}

export default App
